      <Img width="128" src={images} />
      <Heading
        children="見出し"
        className='h2'
        style={{color:"red"}}
      />
      <Icon
        // className='clickable'
        onClick={clickIcon}
        src={images}
      />
      <Txt
        className="l warning"
        text="テキスト"
        // style={{background:"blue"}}
      />
      <DeleteIcon />
      <Notification program={notification} onClickDelete={clickIcon} />
    </>
  );
};

export default App;
